pragma solidity ^0.8.0;

import "./IContractCertified.sol";

struct Currency {
    uint256 balance;
    uint256 reserved;
    uint256 collateral;
    uint256 credit;
    uint256 allowance;
    uint256 collateralcredit;
    uint256 collateralallowance;
    uint256 available;
    uint256 unstackable;
    uint256 creditused;
    uint256 creditavailable;
}

interface IWallet is IContractCertified {

    function ownerOf() external view returns (address);

    function granularity(uint256 granularity_) external pure returns (uint256);

    function account() external view returns (bytes32[] memory,Currency[] memory);

    function accountCurrencies() external view returns (bytes32[] memory);
    function accountCurrencyBatch(bytes32[] calldata currency_) external view returns (Currency[] memory);
    function accountCurrency(bytes32 currency_) external view returns (Currency memory);

    function stake(bytes32 currency_, uint256 amount_) external payable;
    function stake(address token_, uint256 amount_) external payable;
    function stake(address token_, uint256 tokenid_,uint256 amount_) external payable;

    function unstake(bytes32 currency_, uint256 amount_) external;
    function unstake(address token_, uint256 amount_) external;
    function unstake(address token_, uint256 tokenid_, uint256 amount_) external;
}
